import ReactDom from 'react-dom';
import Content from './Content';
import Navbar from './Navbar';
import Header from './Header';
import React from 'react';
import './App.css';
import Post from './Post';
import { BrowserRouter, Route } from 'react-router-dom';
import Dialogs from './Dialogs';
import index from '../index.js';
import addPost from './state.js';


const App = (props) => {     


    return ( 
    <BrowserRouter>

    <div className="app-wrapper">

    <Header />
    <Navbar />

    <Route path='/content' component={Content} />  
    <Route path='/post' render={ () => <Post addPost={props.addPost} posts={props.state.posts} profiles={props.state.profiles}/>} />
    <Route path='/dialogs' render={ () => <Dialogs messages={props.state.messages} dialogs={props.state.dialogs}/>} />

  </div>
  </BrowserRouter>

   );
};



export default App;
